import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import styles from './RaiseRequest.module.css';
import axios from 'axios';

const RaiseRequest = () => {
  const [service, setService] = useState('');
  const [description, setDescription] = useState('');
  const [message, setMessage] = useState('');
  const [isError, setIsError] = useState(false);
  const [isSubmitting, setIsSubmitting] = useState(false);
  const navigate = useNavigate();

  const serviceMap = {
    Plumbing: 1,
    Electricity: 2,
    Garbage: 3,
    Maintenance: 4,
    Other: 5,
  };

  const formatDate = (date) => date.toISOString().split('T')[0];

  const validateForm = () => {
    if (!service) return 'Please select a service';
    if (description.length < 10) return 'Description must be at least 10 characters';
    if (description.length > 500) return 'Description must not exceed 500 characters';
    return null;
  };

  const handleSubmit = () => {
    const error = validateForm();
    if (error) {
      setMessage(error);
      setIsError(true);
      const timeout = setTimeout(() => setMessage(''), 5000);
      return () => clearTimeout(timeout);
    }

    const newRequest = {
      serviceId: serviceMap[service],
      userId: 1, // Replace with actual user ID from auth context
      description: description.trim(),
      createDate: formatDate(new Date()),
      expectedCompletionDate: formatDate(new Date(Date.now() + 3 * 24 * 60 * 60 * 1000)),
    };

    setIsSubmitting(true);

    axios.post(`http://localhost:8080/request/save`, newRequest)
      .then(() => {
        setService('');
        setDescription('');
        setIsError(false);
        setMessage('Request submitted successfully!');
        setTimeout(() => setMessage(''), 3000);
      })
      .catch((error) => {
        setIsError(true);
        if (error.response?.status === 400) {
          setMessage('Invalid request data');
        } else if (error.response?.status === 401) {
          setMessage('Unauthorized: Please log in');
        } else {
          setMessage(error.response?.data?.message || 'Error submitting request');
        }
        console.error("Submit Error:", error);
      })
      .finally(() => setIsSubmitting(false));
  };

  // Cleanup form state on unmount
  useEffect(() => {
    return () => {
      setService('');
      setDescription('');
      setMessage('');
      setIsError(false);
    };
  }, []);

  return (
    <div className={styles.requestForm}>
      <h3>Raise a Service Request</h3>

      <label htmlFor="service-select" className={styles.label}>
        Service Type
      </label>
      <select
        id="service-select"
        value={service}
        onChange={(e) => setService(e.target.value)}
        className={styles.input}
        aria-describedby="service-error"
      >
        <option value="">Select Service</option>
        <option value="Plumbing">Plumbing</option>
        <option value="Electricity">Electricity</option>
        <option value="Garbage">Garbage Collection</option>
        <option value="Maintenance">Maintenance</option>
        <option value="Other">Other</option>
      </select>

      <label htmlFor="description-textarea" className={styles.label}>
        Description
      </label>
      <textarea
        id="description-textarea"
        name="description"
        placeholder="Enter description"
        value={description}
        onChange={(e) => setDescription(e.target.value)}
        className={styles.textarea}
        aria-describedby="description-error"
      />

      <button
        onClick={handleSubmit}
        className={styles.submitButton}
        disabled={isSubmitting}
        aria-busy={isSubmitting}
      >
        {isSubmitting ? (
          <>
            
          </>
        ) : (
          'Submit'
        )}
      </button>

      {message && (
        <p
          id="form-message"
          className={isError ? styles.errorMsg : styles.successMsg}
          role="alert"
        >
          {message}
        </p>
      )}

      <button
        onClick={() => navigate('/userdashboard')}
        className={styles.backBtn}
      >
        Back to Dashboard
      </button>
    </div>
  );
};

export default RaiseRequest;
